import React from "react";
// plugin that creates slider
import Slider from "nouislider";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

import { Card, Button } from '@material-ui/core';

import styles from "assets/jss/material-kit-react/views/componentsSections/basicsStyle.js";
import netflixStyles from "assets/css/netflixStyleCarousel.css";
import { BluetoothDisabled } from "@material-ui/icons";

const useStyles = makeStyles(styles);

export default function LatestUpdates() {
  const classes = useStyles();


  return (
    <div className={classes.section}>
    <div className={classes.container}>
    <h1 style={{paddingTop:"50px"}}>Recent Activity</h1>
    <hr style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
    <div styles={netflixStyles} class="container">
      <div class="box">
        <Card style={{backgroundColor:"#F4F4F4", height: "300px", width: "250px", textAlign:"center"}}>
        <img src={require("../../../assets/img/BDBI.jpeg")} style={{width:"150px", paddingTop:"20px"}}></img>
          <h3><b>Vice President of Big Data Big Impact @ GT</b></h3>

        </Card>
      </div>
      <div class="box">
      <Card style={{backgroundColor:"#F4F4F4", height: "300px", width: "250px", textAlign:"center"}}>
        <img src={require("../../../assets/img/deviparikh.jpg")} style={{width:"150px", paddingTop:"20px"}}></img>
          <h3><b>Incoming Research Assistant for Dr. Devi Parikh in her Creativity + AI initiative</b></h3>
          <Button variant="outlined" color="primary" src="https://www.cc.gatech.edu/~parikh/">View Dr.Parikh's Page</Button>
          <Button variant="outlined" src="https://github.com/purvaten/feel-the-music">View Repository</Button>
        </Card>
      </div>
      <div class="box">

        <Card style={{backgroundColor:"#F4F4F4", height: "300px", width: "250px", textAlign:"center"}}>
          <img src={require("../../../assets/img/dhruvbatra.jpg")} style={{width:"150px", paddingTop:"20px"}}></img>
            <h3><b>Incoming Research Assistant for Dr. Dhruv Batra for his EvalAI platform</b></h3>

        </Card>
      </div>
      <div class="box">
      <Card style={{backgroundColor:"#F4F4F4", height: "300px", width: "250px"}}></Card>
      </div>
    </div>
    </div>
  </div>

  );
}
